import logo from './logo.svg';
import './App.css';
import Main from './layouts/Main';
import { BrowserRouter as Router, Route } from "react-router-dom";


function App() {
  return (
    <>
      <Router>


          <Route path="/" exact>
            <Main />
          </Route>
          <Route path="/main" exact>
            <Main />
          </Route>

      </Router>


    </>
  );
}

export default App;
